import React from "react";
import Comment from "./Comment";
import Todo from "./Todo";
import Input from "./Input";
const TodoList = () => {
  const [todos, setTodos] = useState([
    {
      id: 1,
      text: "아침에눈뜨기",
      checked: false,
    },
    {
      id: 2,
      text: "세수하기",
      checked: false,
    },
    {
      id: 3,
      text: "나는 천재라고 자기암시 하기",
      checked: true,
    },
  ]);
  return (
    <>
      <Input />
      <Todo todos={todos} isChecked={true} />
      <Todo todos={todos} isChecked={false} />

      {/* <Todo />
      <Comment /> */}
    </>
  );
};

export default TodoList;
